import React from "react";
import Favorites from "../components/Favorites";

const Listfav = ({ props }) => {
  return (
    <div> 
        <h1 className="cen has-background-primary">FAVORITOS</h1> 
    <div className="flex-card">

        {props.map((fav, i) => {
          return (
            <div key={i}>
              <Favorites props={fav} />
            </div>
          );
        })}
    </div>
    </div>
  );
};

export default Listfav;
